function BookCreate(onCreate){
    const [title,setTitle] = useState('');

    const handleChange = (event) =>{
        event.preventDefault();
        setTitle(event.target.value);   
        console.log(title);
    
    }

    return <div>
        <form>
            <label>Title</label>
            <input value={title} onChange={handleChange}/>
        </form>
    </div>;
}
export default BookCreate;
